import React, { Component } from 'react'
import {Button} from 'react-bootstrap'
import { Link } from 'react-router-dom'
import Service from './service'

export default class Update extends Component {
  render() {
    return (
      <>    
      <td>{this.props.item.id}</td>
     <td>{this.props.item.name}<br/><br/><Button variant="danger" onClick={this.props.delete.bind(this,this.props.item.id)}>Delete</Button> </td>
      <td> <Link to="/service" >  <img src={this.props.item.avatar} alt="image" title="Image"/> </Link> <Service data={this.props.item.id} /></td>

      </>
    )
  }
}
